Now look at the cell spanning tokens 2–3 (“t5 t57”).  We must combine the sets at 2 ({NT13, NT9}) and 3 ({NT30}).  No binary rule in the grammar has right-hand side NT13 NT30 or NT9 NT30, so that cell is empty.  With no way to build any nonterminal over positions 2–3, the CYK table fails immediately—no derivation can span that pair.  Hence the start symbol S cannot cover the entire string.  

